const LeftNewPost = () => {
    return(
        <div className={Style.WholeCover}>
            <div className={Style.pictureCover}>

            </div>
            <div className={Style.hashtagCover}>

            </div>
            <div className={Style.wordCover}>

            </div>
            <div className={Style.buttonCover}>
                
            </div>
        </div>
    );
}

export default LeftNewPost;
